import React from "react";
import './Navbar.css'
import {useState} from "react";
import { Link } from "react-router-dom";

const NavBar = () => {
    const [menu,setmMenu] = useState("shop")
    return(
        <div className="navbar">
            <p>USER</p>

            <ul className="nav-menu">
                <li onClick={()=>{setmMenu("shop")}}><Link style={{textDecoration:'none'}} to ='/'>SHOP</Link>{menu==="shop"?<hr/>:<></>}</li>
                <li onClick={()=>{setmMenu("apple")}}><Link to = '/apple'>APPLE </Link>{menu==="apple"?<hr/>:<></>}</li>
                <li onClick={()=>{setmMenu("samsung")}}><Link to = '/samsung'>SAMSUNG </Link> {menu==="samsung"?<hr/>:<></>}</li>
                <li onClick={()=>{setmMenu("nothing")}}><Link to = '/nothing'>NOTHING</Link>{menu==="nothing"?<hr/>:<></>}</li>

            </ul>
            <div   className="nav-login-cart">
            <Link to='/login'><button>Login</button></Link>

            </div>
            <div>

            </div>

        </div>

    )
}
export default NavBar
